import { BrowserRouter, NavLink, Route, Routes } from "react-router-dom"
import classessGreg from './Dialogs.module.css'



const dialogs = [
    {
        id: 1,
        name: 'Valera'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Elena'
    }
]


const messages = [
    {
        id: 1,
        message: 'Hy My name is Petr'
    },
    {
        id: 2,
        message: 'MI dont belive youark'
    },
    {
        id: 3,
        message: 'Elena I dont belive you'
    }
]

const DialogItem = (props)=> {
    const link = props.link + props.id

    return <li><NavLink to={link}> {props.name} </NavLink></li>
}


const Message = (props)=> {
    return <div>
        {props.message}
    </div>
}


const elementDialog = dialogs.map(item => <DialogItem link='/dialogs/' key={item.id} id={item.id} name={item.name} />)
const elementMessage = messages.map(item => <Message key={item.id} message={item.message}/>)

const Dialogs = (props)=> {
    return <div className={classessGreg.dialogs}>
        <ul>
            {elementDialog}
        </ul>
        <div>
            {elementMessage}
        </div>
    </div>
}

export default Dialogs
